Ok, I understand your point of view. It is hard to replace exception with error_code. Exception class contains information which property was incorrect and reason either name was not found or type was not matched.

If used in dbus context it will ether never throws or always throws if someone test their code one test will be enough to test it.

If this doesn't convince you I can propose one more overload to sdbusplus (overload which throws can be helpful when debugging or just in any other code which doesn't avoid exceptions).

bool unpackProperties(std::nothrow_t, Container, args...) noexcept;
or
bool unpackPropertiesNoThrow(Container, args...) noexcept;
or
std::optional<ExceptionClass> unpackProperties(std::nothrow_t, Container, args...) noexcept;
or
std::optional<ExceptionClass> unpackPropertiesNoThrow(Container, args...) noexcept;
or whatever you prefer.

Still I would like to keep both of them. In case the no throw version return false, we can get much more information what was wrong from exception class. Even if openBmc will only use no throw version modern C++ advices to use exceptions. Well of course we have to keep in mind that instead of using at on vector we should rather check for size and use [], but this exception will ether never happen or always in case of logic_error (unpackProperties parameters doesn't match with what is actually on dbus).

There is also one more option, there can be two functions in different namespace:

namespace throwing {

}

namespace nonthrowing {

}

one of them can be inline, also version with exception is more useful in unit tests
